<style>
    /* Regular styles for the table */
    .table-responsive-sm {
        width: 100%;
        margin-bottom: 20px;
    }

    .right {
        text-align: right;
    }

    .left {
        text-align: left;
    }

    #print-invoice td,
    #print-invoice th {
        border: none;
        padding-top: 2px;
        padding-bottom: 2px;
    }

    /* @page { */
    /* size: A4; */
    /* Standard A4 paper size */
    /* margin: 10mm; */
    /* Reduce margins to save space */
    /* } */

    /* Centering the content on the print page */
    @media print {
        #print-invoice {
            width: 270px;
            max-width: 270px;
            margin: 0 auto;
            text-align: center;
            align-items: center;
            visibility: visible;
            overflow: hidden;
            transform: scale(1);
            /* Scale down the content */
            transform-origin: top left;
            /* Start scaling from the top-left */
        }

        #print-invoice td,
        #print-invoice th {
            border: none;
        }

        /* Prevent page breaks inside the content */
    }

    a.btn {
        font-size: 14px;
    }

    #print-invoice th,
    #print-invoice td {
        text-align: left;
        border: unset !important;

    }

    @media only screen and (min-width: 992px) and (max-width: 1530px) {
        a.btn {
            font-size: 12px;
        }
    }
</style>
